// src/components/PartnersModal.jsx
import React, { useState, useEffect } from "react";
import Modal from "../components/Modal";

const PartnersModal = ({ onClose, onSave, categories = [], existingPartner = null }) => {
  const isEditMode = existingPartner !== null;

  const [name, setName] = useState(isEditMode ? existingPartner.name : "");
  const [type, setType] = useState(isEditMode ? existingPartner.type : "vendor");
  const [contactInfo, setContactInfo] = useState({
    email: isEditMode && existingPartner.contactInfo.email ? existingPartner.contactInfo.email : "",
    phone: isEditMode && existingPartner.contactInfo.phone ? existingPartner.contactInfo.phone : "",
    address: isEditMode && existingPartner.contactInfo.address ? existingPartner.contactInfo.address : "",
  });
  const [categoryId, setCategoryId] = useState(isEditMode && existingPartner.categoryId ? existingPartner.categoryId._id : "");

  const [error, setError] = useState("");

  const handleSave = () => {
    setError("");

    if (!name.trim()) {
      setError("Partner name is required.");
      return;
    }
    if (!type) {
      setError("Partner type is required.");
      return;
    }
    if (!categoryId) {
      setError("Please select a category.");
      return;
    }

    const partnerData = {
      name,
      type,
      contactInfo,
      categoryId,
    };

    if (isEditMode) {
      partnerData.partnerId = existingPartner._id;
    }

    onSave(partnerData);
  };

  return (
    <Modal onClose={onClose}>
      <div className="p-6 bg-white rounded-lg shadow-lg max-w-lg mx-auto text-black z-50 relative">
        <h2 className="text-xl font-bold mb-4">{isEditMode ? "Edit Partner" : "Add Partner"}</h2>
        {error && <p className="text-red-600 mb-4 text-sm">{error}</p>}

        <div className="space-y-4">
          {/* Partner Name */}
          <div>
            <label className="block text-sm font-medium text-gray-900 mb-1">Name</label>
            <input
              type="text"
              className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-400"
              value={name}
              onChange={(e) => setName(e.target.value)}
            />
          </div>

          {/* Partner Type */}
          <div>
            <label className="block text-sm font-medium text-gray-900 mb-1">Type</label>
            <select
              value={type}
              onChange={(e) => setType(e.target.value)}
              className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-400"
            >
              <option value="vendor">Vendor</option>
              <option value="client">Client</option>
            </select>
          </div>

          {/* Contact Information */}
          <div>
            <label className="block text-sm font-medium text-gray-900 mb-1">Contact Email</label>
            <input
              type="email"
              className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-400"
              value={contactInfo.email}
              onChange={(e) => setContactInfo({ ...contactInfo, email: e.target.value })}
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-900 mb-1">Contact Phone</label>
            <input
              type="tel"
              className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-400"
              value={contactInfo.phone}
              onChange={(e) => setContactInfo({ ...contactInfo, phone: e.target.value })}
            />
          </div>

          <div>
            <label className="block text-sm font-medium text-gray-900 mb-1">Address</label>
            <input
              type="text"
              className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-400"
              value={contactInfo.address}
              onChange={(e) => setContactInfo({ ...contactInfo, address: e.target.value })}
            />
          </div>

          {/* Category Selection */}
          <div>
            <label className="block text-sm font-medium text-gray-900 mb-1">Category</label>
            <select
              value={categoryId}
              onChange={(e) => setCategoryId(e.target.value)}
              className="w-full p-2 border border-gray-300 rounded focus:ring-2 focus:ring-blue-400"
            >
              <option value="">-- Select a Category --</option>
              {categories.map(cat => (
                <option key={cat._id} value={cat._id}>{cat.name}</option>
              ))}
            </select>
          </div>
        </div>

        <div className="flex justify-end mt-6 space-x-3 border-t border-gray-200 pt-4">
          <button
            className="bg-gray-300 text-gray-800 px-4 py-2 rounded hover:bg-gray-400 transition"
            onClick={onClose}
          >
            Cancel
          </button>
          <button
            className="bg-green-600 text-white px-4 py-2 rounded font-semibold hover:bg-green-700 transition"
            onClick={handleSave}
          >
            {isEditMode ? "Update Partner" : "Save Partner"}
          </button>
        </div>
      </div>
    </Modal>
  );
};

export default PartnersModal;
